• PMO Support; 
• Migration; 
• Fast Parcel Operator Readiness; 
• Freight Forwarder Readiness; 
• Software Developer Readiness; 
• Communications and Development; 
• Integration Support; and 
• External Stakeholder Engagement Readiness

This procurement sought  to provide a Delivery Partner to design and implement the Prosperity Fund's Indian Finacial Services programme of interventions. The programme will provide policy support, capacity building and technical assistance. Support India's reform of its financial markets through advocacy and capacity building with central government and financial regulators, including driving implementation of the India-UK Financial Partnership's policy reform recommendations; 
Assist Indian organisations including state infrastructure funds to raise finance overseas, particularly through the City of London, complementing India's National Investment and Infrastructure Fund; and
Support FinTech policy development and boost FinTech entrepreneurship.

This contract has already been awarded and is being published for transparency purposes only. This contract will deliver the following outcomes:
•	Develop a scope and design of the Locality Business Case model and agree this with the Customer;
•	Build and support the use of the Locality Business Case model in accordance with the agreed model scope;
•	Work with the GPU modelling team and wider GPU team to collect and interrogate assumptions that inform the business case model and translate the assumptions into a model;
•	Support the drafting of the Hubs Locality Business Case working alongside the GPU business case team. This role requires utilising the existing GPU Economic Model to provide detailed analysis on the impact of assumption changes; and,
•	Provide analysis using the constructed tools in order to inform scenario analysis and support the strategic decisions being taken in regards to the Hubs Programme Business Case.

