Audit, Recovery and Contract Compliance Services over 10 Lots. The framework is initially for the benefit the Members of the NHS Commercial Alliance however any Trust listed as eligible may utilise the Framework with authorisation form the NHS Commercial Alliance.
The objective is to establish a Framework Agreement for Audit and Recovery Services of any overpayments /duplicate payments made to suppliers by for example errors by NHS Trusts and suppliers. This framework agreement covers 10 Lots outlined as follows:
Lot 1 Telecommunications;
Lot 2 Energy — Electricity /Gas /Oil /Coal / Renewable Energy & CRC / Emissions;
Lot 3 Water;
Lot 4 Vat;
Lot 5 Estates;
Lot 6 Accounts Payable;
Lot 7 Temporary Staffing;
Lot 8 Payroll;
Lot 9 Contract Compliance Audits;
Lot 10 Managed Solution — Bidders who wish to be considered for this Lot must offer the provision of Services covered by Lots 1-9.
